import React from 'react';
import PropTypes from 'prop-types';

//app
import styles from './ClaimsPreviewDashboard.styles';
import * as utils from 'utils';
import { Overflow, Button } from 'components';
// import { InfoViewCard } from './InfoViewCard';
import { ClaimDetailsInfoCard } from 'modules';
import { STATUS_CLAIMS_DRAFT } from 'consts';
//mui

import { makeStyles } from '@material-ui/core';
import { Edit } from '@material-ui/icons';

ClaimsPreviewDashboardView.propTypes = {
  detailsCard: PropTypes.array.isRequired,
  claimsInformation: PropTypes.object.isRequired,
  underWritingGroupColumns: PropTypes.array.isRequired,
};
export function ClaimsPreviewDashboardView(props) {
  const { handleEditClaim, claimsInformation, detailsCard, underWritingGroupColumns } = props;

  const classes = makeStyles(styles, { name: 'ClaimsPreviewDashboard' })();
  if (!claimsInformation) return null;

  return (
    <>
      <div className={classes.wrapper}>
        <Overflow>
          <ClaimDetailsInfoCard detailsCard={detailsCard} underWritingGroupColumns={underWritingGroupColumns} />
        </Overflow>
        <div>
          <Button
            icon={Edit}
            color="default"
            size="small"
            variant="outlined"
            tooltip={{ title: utils.string.t('claims.editClaim') }}
            style={{ border: 'none' }}
            onClick={() => handleEditClaim()}
            disabled={claimsInformation?.claimStatus !== STATUS_CLAIMS_DRAFT}
          />
        </div>
      </div>
    </>
  );
}
